import logo from '../logo/logo.svg';
import styled from 'styled-components';

const Image = styled.image`
    padding-all: 0.5em;
`

export default function Logo() {
  return (
    <div>
        <img src={logo} alt="Title Logo" width="35" height="35"/> 
    </div>
  );
}
